import { useEffect } from "react";
import { CLIENT_ID } from "./GetAccessToken";
import { AUTH_SERVER_ADDRESS } from "./GetAccessToken";
import axios from 'axios';

export default function Logout(){
    // const navigate = useNavigate()

    useEffect(() => {
        axios.get(`${AUTH_SERVER_ADDRESS}/realms/${CLIENT_ID}/protocol/openid-connect/logout`)
    }, []);

}
